import logo from './logo.svg';
import './App.css';
import New from './New';
import { useSelector, useDispatch } from 'react-redux';

const mapStateToProps = useSelector((state) => { state.counter })

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <New />
      </header>
    </div>
  );
}

export default App;
